@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:AuthorizationDialog a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:requestsUserToEnter ;
        owl:someValuesFrom atm:Password
    ] .

atm:requestsUserToEnter a owl:ObjectProperty ;
    rdfs:domain atm:AuthorizationDialog ;
    rdfs:range atm:Password .

atm:Password a owl:Class .
